  return (
    <div className="app">
      {!user ? (<h1>Login</h1>):(
        <>
        <Header />
        <div className = "app__body">
            <Sidebar />
            <Feed />
            <Widget />
        </div>
        </>
      )}
    </div>
  );
}

export default App;
